import React, { useCallback, useState } from "react";

export default function UseCallbackExample() {
    const [render ,setrender]=useState(false)
    let a = 2;
    let b = 2;

    const displayCalcul = useCallback(() => {
        console.log("hhhhhh", a + b);
        return a + b;
    }, [a, b]);
    const clickcolback=()=>{
        console.log("no colback")
    }
    const displayrender=()=>{
        setrender(true)
    }

    return (
        <>
            <input
                type="submit"
                value="Click"
                onClick={displayCalcul}
            />
            
            <input
                type="submit"
                value="clickcolback"  onClick={clickcolback}
            />

              
<input
                type="submit"
                value="clickcolback"  onClick={displayrender}
            />
        </>
    );
}
